// Normalizador Universal para BX - Catálogo Homologado v3.0
// Compatible con n8n Code Node
// ============================================

const crypto = require('crypto');

// ============================================
// CONFIGURACIÓN ESPECÍFICA
// ============================================
const ASEGURADORA = 'BX';

// ============================================
// FUNCIONES DE NORMALIZACIÓN UNIVERSAL
// ============================================

function sha256(text) {
  return crypto.createHash('sha256').update(text).digest('hex');
}

function normalizarTexto(texto) {
  if (!texto) return '';

  return String(texto)
    .toUpperCase()
    .normalize('NFD')
    .replace(/[\u0300-\u036f]/g, '')  // Remover acentos
    .replace(/[^A-Z0-9\s\-]/g, '')    // Mantener solo alfanuméricos y guiones
    .replace(/\s+/g, ' ')
    .trim();
}

function normalizarMarca(marca) {
  if (!marca) return '';

  const marcaNorm = normalizarTexto(marca);

  // Mapeo de sinónimos comunes
  const sinonimos = {
    'VOLKSWAGEN': ['VW', 'VOLKS', 'VOLKSWAGEN', 'VOLKSWAGON'],
    'CHEVROLET': ['CHEVY', 'CHEVROLET', 'GM', 'CHEV'],
    'MERCEDES BENZ': ['MERCEDES', 'BENZ', 'MERCEDES-BENZ', 'MB', 'MERCEDES BENZ'],
    'BMW': ['BMW', 'BAYERISCHE MOTOREN WERKE'],
    'FORD': ['FORD', 'FORD MOTOR', 'FMC'],
    'NISSAN': ['NISSAN', 'DATSUN'],
    'MAZDA': ['MAZDA', 'MZD'],
    'HYUNDAI': ['HYUNDAI', 'HYU'],
    'KIA': ['KIA', 'KIA MOTORS'],
    'MITSUBISHI': ['MITSUBISHI', 'MITS'],
    'INFINITY': ['INFINITY', 'INFINITI'],
    'LAND ROVER': ['LAND ROVER', 'LANDROVER'],
    'ALFA ROMEO': ['ALFA ROMEO', 'ALFAROMEO', 'ALFA'],
    'MINI': ['MINI', 'MINI COOPER'],
    'GMC': ['GMC', 'GENERAL MOTORS COMPANY']
  };

  for (const [marcaEstandar, variantes] of Object.entries(sinonimos)) {
    if (variantes.some(v => marcaNorm === v || marcaNorm.includes(v))) {
      return marcaEstandar;
    }
  }

  return marcaNorm;
}

function normalizarModelo(modelo, marca) {
  if (!modelo) return '';

  let modeloNorm = normalizarTexto(modelo);
  const marcaNorm = normalizarTexto(marca);

  // Eliminar prefijo de marca si existe
  if (modeloNorm.startsWith(marcaNorm + ' ')) {
    modeloNorm = modeloNorm.substring(marcaNorm.length + 1);
  }

  // Eliminar "MINI " del inicio si la marca es BMW y el modelo empieza con MINI
  if (marcaNorm === 'BMW' && modeloNorm.startsWith('MINI ')) {
    modeloNorm = modeloNorm.substring(5);
  }

  // Normalización específica de modelos comunes
  modeloNorm = modeloNorm
    .replace(/^SERIE\s+(\d)/, 'SERIE $1')
    .replace(/^CLASE\s+([A-Z])/, 'CLASE $1')
    .replace(/\s+SERIE$/, ' SERIES');

  return modeloNorm;
}

function normalizarTransmisionBinaria(codigo, descripcion, version) {
  // Prioridad 1: Código numérico
  if (codigo === 1) return 'MANUAL';
  if (codigo === 2) return 'AUTO';

  // Prioridad 2: Descripción
  const descUpper = normalizarTexto(descripcion || '');
  if (descUpper.includes('MANUAL') || descUpper === 'MANUAL') {
    return 'MANUAL';
  }
  if (descUpper.includes('AUTO') || descUpper === 'AUTO') {
    return 'AUTO';
  }

  // Prioridad 3: Buscar en la versión
  const versionUpper = normalizarTexto(version || '');
  if (versionUpper.includes(' MANUAL') || versionUpper.includes(' STD') || 
      versionUpper.includes(' EST') || versionUpper.includes(' MT ')) {
    return 'MANUAL';
  }
  if (versionUpper.includes(' AUT') || versionUpper.includes(' CVT') || 
      versionUpper.includes(' DCT') || versionUpper.includes(' TIPTRONIC') ||
      versionUpper.includes(' S TRONIC') || versionUpper.includes(' AT ')) {
    return 'AUTO';
  }

  // Default basado en el formato más común de BX
  return 'AUTO';
}

function extraerEspecificacionesTecnicasBX(version) {
  const specs = {
    configuracion_motor: null,
    cilindrada_l: null,
    traccion: null,
    numero_puertas: null,
    tipo_carroceria: null,
    potencia_hp: null,
    numero_ocupantes: null
  };

  const texto = (version || '').toUpperCase();

  // 1. POTENCIA EN CP o HP (muy común en BX)
  let potencia = texto.match(/(\d+)\s*CP/);
  if (potencia) {
    specs.potencia_hp = parseInt(potencia[1], 10);
  } else {
    potencia = texto.match(/(\d+)\s*HP/);
    if (potencia) {
      specs.potencia_hp = parseInt(potencia[1], 10);
    }
  }

  // 2. NÚMERO DE PUERTAS
  const puertas = texto.match(/(\d+)\s*PUERTA/);
  if (puertas) {
    specs.numero_puertas = parseInt(puertas[1], 10);
  } else {
    const ptas = texto.match(/(\d+)\s*PTAS?/);
    if (ptas) {
      specs.numero_puertas = parseInt(ptas[1], 10);
    }
  }

  // 3. CONFIGURACIÓN DE MOTOR (L3, L4, L6, V6, V8, etc.)
  if (texto.match(/\bL3\b/)) {
    specs.configuracion_motor = 'L3';
  } else if (texto.match(/\bL4\b/)) {
    specs.configuracion_motor = 'L4';
  } else if (texto.match(/\bL5\b/)) {
    specs.configuracion_motor = 'L5';
  } else if (texto.match(/\bL6\b/)) {
    specs.configuracion_motor = 'L6';
  } else if (texto.match(/\bV6\b/)) {
    specs.configuracion_motor = 'V6';
  } else if (texto.match(/\bV8\b/)) {
    specs.configuracion_motor = 'V8';
  } else if (texto.match(/\bV10\b/)) {
    specs.configuracion_motor = 'V10';
  } else if (texto.match(/\bV12\b/)) {
    specs.configuracion_motor = 'V12';
  } else if (texto.match(/\bW12\b/)) {
    specs.configuracion_motor = 'W12';
  } else if (texto.match(/\bH4\b/) || texto.includes('BOXER')) {
    specs.configuracion_motor = 'H4';
  } else if (texto.match(/\bH6\b/)) {
    specs.configuracion_motor = 'H6';
  } else if (texto.includes('ELECTRICO') || texto.includes('ELECTRIC')) {
    specs.configuracion_motor = 'ELECTRICO';
  }

  // 4. CILINDRADA (1.5T, 2.0L, etc.)
  const cilindrada = texto.match(/(\d+\.?\d*)[TL]\b/);
  if (cilindrada) {
    specs.cilindrada_l = parseFloat(cilindrada[1]);
  }

  // 5. TIPO DE COMBUSTIBLE/MOTOR
  if (!specs.configuracion_motor || specs.configuracion_motor !== 'ELECTRICO') {
    if (texto.includes('ELECTRICO') || texto.includes('ELECTRIC') || 
        texto.includes(' EV ') || texto.includes(' BEV ')) {
      specs.configuracion_motor = 'ELECTRICO';
    } else if (texto.includes(' PHEV ') || texto.includes('PLUG-IN') || texto.includes('PLUGIN')) {
      specs.configuracion_motor = 'HIBRIDO-PLUGIN';
    } else if (texto.includes(' HEV ') || texto.includes(' HYBRID ') || 
               texto.includes(' HIBRIDO ') || texto.includes(' MHEV ')) {
      specs.configuracion_motor = 'HIBRIDO';
    } else if (texto.includes('DIESEL') || texto.includes(' TDI ') || 
               texto.includes(' TD ') || texto.includes(' CDI ')) {
      if (!specs.configuracion_motor) specs.configuracion_motor = 'DIESEL';
    } else if (texto.includes('TURBO') || texto.match(/\d+T\b/)) {
      if (!specs.configuracion_motor) specs.configuracion_motor = 'TURBO';
    }
  }

  // 6. TRACCIÓN
  if (texto.includes('AWD') || texto.includes('ALL WHEEL')) {
    specs.traccion = 'AWD';
  } else if (texto.includes('QUATTRO')) {
    specs.traccion = 'AWD';
  } else if (texto.includes('XDRIVE')) {
    specs.traccion = 'AWD';
  } else if (texto.includes('SDRIVE')) {
    specs.traccion = 'RWD';
  } else if (texto.includes('4MATIC')) {
    specs.traccion = 'AWD';
  } else if (texto.includes('4MOTION')) {
    specs.traccion = 'AWD';
  } else if (texto.includes('SH-AWD') || texto.includes('SHAWD')) {
    specs.traccion = 'AWD';
  } else if (texto.includes('FWD') || texto.includes('FRONT WHEEL')) {
    specs.traccion = 'FWD';
  } else if (texto.includes('RWD') || texto.includes('REAR WHEEL')) {
    specs.traccion = 'RWD';
  } else if (texto.includes('4X4') || texto.includes('4WD')) {
    specs.traccion = '4WD';
  } else if (texto.includes('4X2')) {
    specs.traccion = '2WD';
  }

  // 7. TIPO DE CARROCERÍA
  if (texto.includes('GRAN COUPE') || texto.includes('GRAN-COUPE')) {
    specs.tipo_carroceria = 'GRAN COUPE';
  } else if (texto.includes('COUPE')) {
    specs.tipo_carroceria = 'COUPE';
  } else if (texto.includes('SEDAN')) {
    specs.tipo_carroceria = 'SEDAN';
  } else if (texto.includes('SUV')) {
    specs.tipo_carroceria = 'SUV';
  } else if (texto.includes('HATCHBACK') || texto.includes('HATCH')) {
    specs.tipo_carroceria = 'HATCHBACK';
  } else if (texto.includes('SPORTBACK') || texto.includes('SPORT BACK')) {
    specs.tipo_carroceria = 'SPORTBACK';
  } else if (texto.includes('WAGON') || texto.includes('ESTATE')) {
    specs.tipo_carroceria = 'WAGON';
  } else if (texto.includes('PICKUP') || texto.includes('PICK UP') || texto.includes('PICK-UP')) {
    specs.tipo_carroceria = 'PICKUP';
  } else if (texto.includes('CARGO') || texto.includes('VAN')) {
    specs.tipo_carroceria = 'VAN';
  } else if (texto.includes('CONVERTIBLE') || texto.includes('CABRIO') || texto.includes('ROADSTER')) {
    specs.tipo_carroceria = 'CONVERTIBLE';
  } else if (texto.includes('CROSSOVER') || texto.includes('CROSS')) {
    specs.tipo_carroceria = 'CROSSOVER';
  } else if (texto.includes('MINIVAN')) {
    specs.tipo_carroceria = 'MINIVAN';
  }

  // 8. ESTIMACIÓN DE OCUPANTES basado en puertas y tipo
  if (!specs.numero_ocupantes && specs.numero_puertas) {
    if (specs.numero_puertas === 2) {
      specs.numero_ocupantes = specs.tipo_carroceria === 'PICKUP' ? 2 : 4;
    } else if (specs.numero_puertas === 3) {
      specs.numero_ocupantes = 5;
    } else if (specs.numero_puertas === 4) {
      specs.numero_ocupantes = 5;
    } else if (specs.numero_puertas === 5) {
      specs.numero_ocupantes = specs.tipo_carroceria === 'SUV' ? 7 : 5;
    }
  }

  return specs;
}

function normalizarVersionTrim(version, marca, modelo) {
  if (!version) return '';

  let versionNorm = normalizarTexto(version);

  // Limpiar formato específico de BX (separado por comas)
  // Remover elementos técnicos típicos de BX
  versionNorm = versionNorm
    // Remover configuración de motor
    .replace(/,?\s*[LVI]\d+/g, '')
    // Remover cilindrada
    .replace(/,?\s*\d+\.\d+[TL]/g, '')
    // Remover potencia
    .replace(/,?\s*\d+\s*CP/g, '')
    .replace(/,?\s*\d+\s*HP/g, '')
    // Remover puertas
    .replace(/,?\s*\d+\s*PUERTAS?/g, '')
    .replace(/,?\s*\d+\s*PTAS?/g, '')
    // Remover transmisión
    .replace(/,?\s*(AUT|AUTOMATICA|AUTOMATIC|STD|STANDARD|MANUAL|EST|CVT|DCT|TIPTRONIC|S TRONIC)/g, '')
    // Remover tipos de combustible/motor
    .replace(/,?\s*(ELECTRICO|ELECTRIC|PHEV|HEV|HYBRID|HIBRIDO|MHEV|DIESEL|TDI|TURBO)/g, '')
    // Remover tracción
    .replace(/,?\s*(AWD|FWD|RWD|4X4|4X2|QUATTRO|XDRIVE|SDRIVE|4MATIC|4MOTION|SH-AWD)/g, '')
    // Limpiar comas y espacios múltiples
    .replace(/,+/g, '')
    .replace(/\s+/g, ' ')
    .trim();

  // Aplicar guiones canónicos para términos específicos
  const guionesCanonicos = {
    'TYPE S': 'TYPE-S',
    'TYPE R': 'TYPE-R',
    'A SPEC': 'A-SPEC',
    'S LINE': 'S-LINE',
    'R LINE': 'R-LINE',
    'M SPORT': 'M-SPORT',
    'GRAN COUPE': 'GRAN-COUPE',
    'JOHN COOPER': 'JOHN-COOPER',
    'COOPER S': 'COOPER-S',
    'KING RANCH': 'KING-RANCH',
    'BLACK EDITION': 'BLACK-EDITION',
    'M COMPETITION': 'M-COMPETITION'
  };

  for (const [buscar, reemplazar] of Object.entries(guionesCanonicos)) {
    const regex = new RegExp('\\b' + buscar + '\\b', 'g');
    versionNorm = versionNorm.replace(regex, reemplazar);
  }

  return versionNorm.trim();
}

function normalizarDecimal(valor, decimales = 1) {
  if (!valor || valor === 'NULL' || valor === 'null') return null;
  const num = parseFloat(valor);
  return isNaN(num) ? null : parseFloat(num.toFixed(decimales));
}

function normalizarEntero(valor) {
  if (!valor || valor === 'NULL' || valor === 'null') return null;
  const num = parseInt(valor, 10);
  return isNaN(num) ? null : num;
}

function construirSpecSignature(data) {
  const specs = [
    data.configuracion_motor || '__NA__',
    data.cilindrada_l !== null ? String(data.cilindrada_l) : '__NA__',
    data.traccion || '__NA__',
    data.numero_puertas !== null ? String(data.numero_puertas) : '__NA__',
    data.tipo_carroceria || '__NA__',
    data.potencia_hp !== null ? String(data.potencia_hp) : '__NA__',
    data.numero_ocupantes !== null ? String(data.numero_ocupantes) : '__NA__'
  ];

  return specs.join('|');
}

// ============================================
// PROCESAMIENTO PRINCIPAL
// ============================================

const items = [];
const duplicadosDetectados = new Set();
const hashesUnicos = new Set();

for (const item of $input.all()) {
  const data = item.json;

  // Validación de datos obligatorios
  if (!data.marca || !data.modelo || !data.año || !data.version) {
    console.log(`⚠️ Registro sin datos completos - ID: ${data.id_original}`);
    continue;
  }

  // Validación de año
  const año = parseInt(data.año, 10);
  if (isNaN(año) || año < 2000 || año > 2026) {
    console.log(`⚠️ Año inválido: ${data.año} - ID: ${data.id_original}`);
    continue;
  }

  // Normalización principal
  const marcaNormalizada = normalizarMarca(data.marca);
  const modeloNormalizado = normalizarModelo(data.modelo, data.marca);
  const versionNormalizada = normalizarVersionTrim(data.version, data.marca, data.modelo);
  const transmisionNormalizada = normalizarTransmisionBinaria(
    data.transmision_codigo,
    data.transmision_descripcion,
    data.version
  );

  // Validación de transmisión
  if (!transmisionNormalizada || (transmisionNormalizada !== 'AUTO' && transmisionNormalizada !== 'MANUAL')) {
    console.log(`⚠️ Transmisión no determinada - ID: ${data.id_original}, Version: ${data.version}`);
    continue;
  }

  // Extracción y normalización de especificaciones técnicas
  // Primero usamos las columnas del query si tienen datos
  let specsNormalizadas = {
    configuracion_motor: normalizarTexto(data.configuracion_motor) || null,
    cilindrada_l: normalizarDecimal(data.cilindrada_l),
    traccion: normalizarTexto(data.traccion) || null,
    numero_puertas: normalizarEntero(data.numero_puertas),
    tipo_carroceria: normalizarTexto(data.tipo_carroceria) || null,
    potencia_hp: normalizarEntero(data.potencia_hp),
    numero_ocupantes: normalizarEntero(data.numero_ocupantes)
  };

  // Si faltan specs, extraer desde la descripción (formato específico de BX)
  const specsExtraidos = extraerEspecificacionesTecnicasBX(data.version);

  // Combinar specs del query con los extraídos (prioridad a los del query)
  specsNormalizadas = {
    configuracion_motor: specsNormalizadas.configuracion_motor || specsExtraidos.configuracion_motor,
    cilindrada_l: specsNormalizadas.cilindrada_l || specsExtraidos.cilindrada_l,
    traccion: specsNormalizadas.traccion || specsExtraidos.traccion,
    numero_puertas: specsNormalizadas.numero_puertas || specsExtraidos.numero_puertas,
    tipo_carroceria: specsNormalizadas.tipo_carroceria || specsExtraidos.tipo_carroceria,
    potencia_hp: specsNormalizadas.potencia_hp || specsExtraidos.potencia_hp,
    numero_ocupantes: specsNormalizadas.numero_ocupantes || specsExtraidos.numero_ocupantes
  };

  // Construir spec_signature
  const specSignature = construirSpecSignature(specsNormalizadas);

  // Construir hash_comercial
  const hashComponentsComercial = {
    marca: marcaNormalizada,
    modelo: modeloNormalizado,
    año: año,
    version_trim: versionNormalizada,
    transmision_bin: transmisionNormalizada
  };

  const hashStringComercial = `${marcaNormalizada}|${modeloNormalizado}|${año}|${versionNormalizada}|${transmisionNormalizada}`;
  const hashComercial = sha256(hashStringComercial.toUpperCase());

  // Construir hash_tecnico
  const hashStringTecnico = `${hashComercial}|${specSignature}`;
  const hashTecnico = sha256(hashStringTecnico);

  // Detectar duplicados
  if (hashesUnicos.has(hashTecnico)) {
    duplicadosDetectados.add(data.id_original);
    console.log(`⚠️ Duplicado detectado - ID: ${data.id_original}, Hash: ${hashTecnico.substring(0, 8)}...`);
    continue;
  }
  hashesUnicos.add(hashTecnico);

  // Construir hash_components_tecnico
  const hashComponentsTecnico = {
    ...hashComponentsComercial,
    ...Object.fromEntries(
      Object.entries(specsNormalizadas)
        .filter(([_, valor]) => valor !== null)
        .map(([key, valor]) => [key, valor])
    )
  };

  // Agregar valores __NA__ para campos null en hash_components_tecnico
  for (const [key, valor] of Object.entries(specsNormalizadas)) {
    if (valor === null) {
      hashComponentsTecnico[key] = '__NA__';
    }
  }

  // Construir objeto final
  items.push({
    json: {
      // Hashes
      hash_comercial: hashComercial,
      hash_tecnico: hashTecnico,

      // Datos fuente (sin normalizar)
      marca: data.marca,
      modelo: data.modelo,
      año: año,
      version: data.version,
      version_corta: data.version_corta || null,
      transmision_codigo: data.transmision_codigo || null,
      transmision_descripcion: data.transmision_descripcion || null,

      // Normalizados (comerciales)
      marca_normalizada: marcaNormalizada,
      modelo_normalizado: modeloNormalizado,
      version_normalizada: versionNormalizada,
      transmision_normalizada: transmisionNormalizada,

      // Especificaciones técnicas
      ...specsNormalizadas,
      spec_signature: specSignature,

      // Aseguradoras disponibles (formato requerido)
      aseguradoras_disponibles: [
        {
          aseguradora: ASEGURADORA,
          id_original: data.id_original,
          activo: data.activo === true || data.activo === 1
        }
      ],

      // IDs de catálogo
      catalogo_marca_id: data.catalogo_marca_id || null,
      catalogo_modelo_id: data.catalogo_modelo_id || null,

      // Hash components para trazabilidad
      hash_components_comercial: hashComponentsComercial,
      hash_components_tecnico: hashComponentsTecnico
    }
  });
}

// Resumen de procesamiento con métricas detalladas
const registrosConSpecs = items.filter(item => {
  const specs = item.json;
  return specs.numero_puertas || specs.cilindrada_l || specs.traccion || 
         specs.tipo_carroceria || specs.potencia_hp || specs.configuracion_motor ||
         specs.numero_ocupantes;
}).length;

// Métricas específicas de BX
const registrosConPotencia = items.filter(i => i.json.potencia_hp).length;

console.log(`
==========================================
📊 Resumen de procesamiento - ${ASEGURADORA}
==========================================
- Registros entrada: ${$input.all().length}
- Duplicados detectados: ${duplicadosDetectados.size}
- Registros válidos: ${items.length}
- Registros con specs: ${registrosConSpecs} (${((registrosConSpecs / items.length) * 100).toFixed(1)}%)
- Tasa de éxito: ${((items.length / $input.all().length) * 100).toFixed(1)}%

📋 Especificaciones extraídas:
- Con potencia HP: ${registrosConPotencia} ⭐ (BX incluye CP)
- Con puertas: ${items.filter(i => i.json.numero_puertas).length}
- Con cilindrada: ${items.filter(i => i.json.cilindrada_l).length}
- Con config motor: ${items.filter(i => i.json.configuracion_motor).length}
- Con tracción: ${items.filter(i => i.json.traccion).length}
- Con carrocería: ${items.filter(i => i.json.tipo_carroceria).length}
- Con ocupantes: ${items.filter(i => i.json.numero_ocupantes).length}
==========================================
`);

// Log de muestra con registro más completo
if (items.length > 0) {
  console.log('📝 Muestra de registro procesado con specs:');
  const muestra = items.find(i => 
    i.json.potencia_hp && i.json.numero_puertas && i.json.cilindrada_l
  ) || items.find(i => i.json.potencia_hp) || items[0];

  console.log(JSON.stringify({
    marca: muestra.json.marca,
    modelo: muestra.json.modelo,
    año: muestra.json.año,
    version_original: muestra.json.version,
    version_normalizada: muestra.json.version_normalizada,
    transmision: muestra.json.transmision_normalizada,
    specs: {
      potencia_hp: muestra.json.potencia_hp,
      puertas: muestra.json.numero_puertas,
      cilindrada: muestra.json.cilindrada_l,
      motor: muestra.json.configuracion_motor,
      traccion: muestra.json.traccion,
      carroceria: muestra.json.tipo_carroceria,
      ocupantes: muestra.json.numero_ocupantes
    },
    hash_comercial: muestra.json.hash_comercial.substring(0, 8) + '...',
    hash_tecnico: muestra.json.hash_tecnico.substring(0, 8) + '...'
  }, null, 2));
}

return items;

// Nodo: Deduplicate Source Data
const items = $input.all();
const seen = new Map();

for (const item of items) {
  const key = `${item.json.marca}|${item.json.modelo}|${item.json.año}|${item.json.version_completa}`;

  if (!seen.has(key) || item.json.fecha_actualizacion > seen.get(key).json.fecha_actualizacion) {
    seen.set(key, item);
  }
}

return Array.from(seen.values());

// Nodo: Deduplicate by Hash - CRÍTICO para evitar duplicados
const items = $input.all();
const uniqueByHash = new Map();
const duplicates = new Map();

// Procesar todos los items
items.forEach(item => {
  const hash = item.json.hash_unico;

  if (!hash) {
    return;
  }

  if (uniqueByHash.has(hash)) {
    // Contar duplicados
    if (!duplicates.has(hash)) {
      duplicates.set(hash, [uniqueByHash.get(hash)]);
    }
    duplicates.set(hash, [...duplicates.get(hash), item]);
  } else {
    uniqueByHash.set(hash, item);
  }
});

// Reportar duplicados encontrados
if (duplicates.size > 0) {  
  // Mostrar ejemplos de duplicados
  let exampleCount = 0;
  for (const [hash, items] of duplicates.entries()) {
    if (exampleCount >= 5) break;

    console.log(`\n🔍 Hash duplicado: ${hash.substring(0, 16)}...`);
    console.log(`   Registros: ${items.length}`);

    // Mostrar los primeros 2 registros del duplicado
    items.slice(0, 2).forEach((item, idx) => {
      const data = item.json;
    });

    exampleCount++;
  }

  // Análisis de por qué se duplican
  const duplicateAnalysis = new Map();
  for (const [hash, items] of duplicates.entries()) {
    const firstItem = items[0].json;
    const key = `${firstItem.marca_normalizada}|${firstItem.modelo_normalizado}`;

    if (!duplicateAnalysis.has(key)) {
      duplicateAnalysis.set(key, 0);
    }
    duplicateAnalysis.set(key, duplicateAnalysis.get(key) + 1);
  }

  const sortedAnalysis = Array.from(duplicateAnalysis.entries())
    .sort((a, b) => b[1] - a[1])
    .slice(0, 10);

  sortedAnalysis.forEach(([key, count]) => {
    console.log(`   ${key}: ${count} hashes duplicados`);
  });
}

// Estadísticas finales
const finalItems = Array.from(uniqueByHash.values());

return finalItems;
